import React from 'react';
import {Alert, Form, Card, Col, Input, InputGroup, InputGroupAddon, Row, Button} from 'reactstrap';
import {Redirect} from 'react-router-dom';
/***** STYLES ******/
import "../css/login.css";
import "../css/validacionLogin.css";
const logo = 'data:image/png;base64,';

 class login extends React.Component {
    constructor (props) {
        super(props);
        let loggedIn= false;
        this.state ={
            username:'',
            password:'',
            sec:'Admin',
            loggedIn:'',
            loggedVentas:'',
            loggedViajes:'',
            loggedMatriz:'',
            loggedCancelaciones: '',
            validationUsuario: true,
            validationContrasena: true,
            visible: false
        }
        this.onChange = this.onChange.bind(this);
        this.submitForm = this.submitForm.bind(this);
        //this.submitForm = this.submitForm.bind(this);
        this.handleUsuario = this.handleUsuario.bind(this);
        this.handleContrasena = this.handleContrasena.bind(this);
        this.onDismiss = this.onDismiss.bind(this);
        this.fetchUser = this.fetchUser.bind(this);
        this.ShowPass = this.ShowPass.bind(this);
    }

    ShowPass(){
        var tipo = document.getElementById("password");
        if(tipo.type == "password"){
            tipo.type = "text";
        }else{
            tipo.type = "password";
        }
    }

    onDismiss() {
        this.setState({ visible: false });
    }
    onChange(e){
        this.setState({
           [e.target.name] : e.target.value
        })
    }
    fetchUser(){ //Aqui busca al usuario segun el id
        fetch(`/api/Usuarios/${this.state.username}`)
                .then(res => res.json())
                .then(data => {
                    console.log(data);
                    if(data.length > 0){
                        if(data[0].nickname == this.state.username && data[0].password == this.state.password){
                            console.log('usuario y contrasea correctos');
                            switch (data[0].seguridad) {
                                case 'Admin':
                                    this.setState({
                                        loggedIn:true
                                    })
                                    break;
                                case 'Ventas':
                                    this.setState({
                                        loggedVentas:true
                                    })
                                    break;
                                case 'Viajes':
                                    this.setState({
                                        loggedViajes:true
                                    })
                                    break;
                                case 'Reservaciones':
                                    this.setState({
                                        loggedReservaciones: true
                                    });
                                    break;
                                case 'Matriz':
                                    this.setState({
                                        loggedMatriz:true
                                    })
                                    break;
                                case 'Cancelaciones':
                                    this.setState({
                                        loggedCancelaciones:true
                                    })
                                    break;
                                default:
                                    break;
                            }
                        }else{
                            this.setState({visible: true})
                        }
                    }else{
                        this.setState({visible: true})
                    }
                });
    }
    handleUsuario(){
        this.setState({
            validationUsuario: true
        })
    }
    handleContrasena(){
        this.setState({
            validationContrasena: true
        })
    }
    submitForm(e){        
           e.preventDefault();
           const {username, password, sec} = this.state

           //Primero haremos la validacion de los campos
            let usuario = document.getElementById("username").value;
            let contrasena = document.getElementById("password").value;

            if(usuario == null || usuario == ""){
                console.log('el usuario es nulo');
                this.setState({
                    validationUsuario: false
                })
            }
            if(contrasena == null || contrasena == ""){
                console.log('la contrasena es nula');
                this.setState({
                    validationContrasena: false
                })
            }        
           //

           if(this.state.validationUsuario && this.state.validationContrasena){
               //console.log('aqui ya entramos');

               //Aqui se debe consultar a la DB para validar ahora  que los datos sean correctos


               //codigo que hay que regresar
               this.fetchUser();

               //En el siguiente codigo, ya nos manda a nuestro navbar que nos corresponde
               /*if(username=="a" && password=="b" && sec=="Admin"){
                this.setState({
                    loggedIn:true
                })
                }
                if(username=="a" && password=="b" && sec=="Ventas"){
                    this.setState({
                        loggedVentas:true
                    })
                }
                if(username=="a" && password=="b" && sec=="Viajes"){
                    this.setState({
                        loggedViajes:true
                    })
                }
                if(username=="a" && password=="b" && sec=="Matriz"){
                this.setState({
                    loggedMatriz:true
                    })
                }*/

           }

           

           
    }
    render() {
        if(this.state.loggedIn){
            return <Redirect to= {"/Index/"+this.state.username}/>
        }
        if(this.state.loggedVentas){
            return <Redirect to= {"/Ventas_Index/"+this.state.username}/>
        }
        if(this.state.loggedReservaciones){
            return <Redirect to= {"/Reservaciones_Index/"+this.state.username}/>
        }
        if(this.state.loggedViajes){
            return <Redirect to= {"/Viajes_Index/"+this.state.username}/>
        }
        if(this.state.loggedMatriz){
            return <Redirect to= {"/Matriz_Index/"+this.state.username}/>
        }
        if(this.state.loggedCancelaciones){
            return <Redirect to= {"/Cancelacion_Index/"+this.state.username}/>
        }
        
        return(
            <div class="fondo">
            <div class="cuadrito">
                    <div class="margen"> 
                        <div class="centrar" >
                            <img src={logo} width="auto" height="60"/>       
                            <h1>Iniciar Sesin</h1>
                        </div>
                        <div class="formulario centrar">
                            <Form onSubmit ={this.submitForm}>
                                <Row>
                                    <div className="col-md-8 col-sm-8 col-lg-8">
                                        <div className={(this.state.validationUsuario) ? 'card border-light centrar': 'card border-secondary centrar'}>
                                            <Input class="txt" type="text" placeholder="Usuario" name="username" id="username" value ={this.state.username} onChange={this.onChange} onKeyDown={this.handleUsuario}/>
                                        </div>
                                        <p className={(this.state.validationUsuario) ? 'textValidLoggin': 'textInvalidLoggin'}>Ingrese nombre de usuario</p>
                                    </div>
                                </Row>
                                <br/>
                                <Row>
                                    <div className="input-group col-md-12 col-sm-12 col-lg-12 text-center">
                                        <div  className={(this.state.validationContrasena) ? 'card border-light': 'card border-secondary'}>
                                            <input type="password" class="form-control" placeholder="Contrasea" name="password" id="password" value ={this.state.password} onChange={this.onChange} onKeyDown={this.handleContrasena}/>
                                        </div>
                                        <div className="input-group-append">
                                            <button class="btn btn-primary" type="button" onClick={this.ShowPass}><i class="fas fa-eye"></i></button>
                                        </div>
                                    </div>
                                    <p className={(this.state.validationContrasena) ? 'textValidLoggin': 'textInvalidLoggin'}>Ingrese contrasea</p>
                                </Row>
                                <br/>
                                <Row>
                                    <Col lg="12" md="12" sm="12">
                                        <div class="centrar">
                                            <Button type="submit" size="lg" block class="boton">Entrar</Button>
                                        </div>
                                    </Col>
                                </Row>
                            </Form>
                        </div>
                    </div>
            </div>
            {/* Si hay alguna contrasena o usuario incorrecto, se mostrara */}
            {(this.state.visible)? 
                    (
                        <Alert color="danger" isOpen={this.state.visible} toggle={this.onDismiss}>
                            <h5 className="text-center">Usuario o contrasea incorrectos!!</h5>
                        </Alert>
                    )
                    :
                    ''
                }
                        
            {/* FIN  Si hay alguna contrasena o usuario incorrecto, se mostrara*/}
            </div>
        );
    }
}
export default login;